import "./Movie.css";
export default function Movie({
  movieName,
  movieOverview,
  movieRating,
  movieReleaseDate,
  moviePoster,
}) {
  return (
    <div className="movie">
      <div className="movie-title">
        <p>{movieName}</p>
      </div>
      <img src={`https://image.tmdb.org/t/p/w200/${moviePoster}`}></img>
      <p className="movie-rating">{movieRating}</p>
      <p className="movie-release">{movieReleaseDate}</p>
      <p className="overview">{movieOverview}</p>
    </div>
  );
}
